Brothers Bloom, The (2008)  

Verenigde Staten
Komedie / Misdaad
109 minuten

geregisseerd door Rian Johnson
met Adrien Brody, Rachel Weisz en Mark Ruffalo

De gebroeders Bloom behoren tot de wereldtop als het gaat om de kunst van het oplichten. Samen met hun vrouwelijke partner bezwendelen ze al jaren menig rijk persoon, maar de jongste van de broers heeft er genoeg van en besluit dit leven op te geven. Hij wordt echter overgehaald tot een laatste klus, het oplichten van een excentrieke miljonair, maar hierdoor krijgt hij problemen met zijn geliefde.

